import React from 'react'

function TableHeader() {
    return (
        <thead>
          <tr>
            <th>File_Name</th>
            <th>Run Frequency</th>
            <th>Status</th>
          </tr>
        </thead>
    );  
}

function getFreq(fileName, config) {
    currentElement = ""
    Object.keys(config).forEach(element => {
        if (config[element].includes(fileName.slice(0, -4))) {
            currentElement = element;
        }
    });
}

function TableBody(props) {
    const rows = Object.keys(props.logs).map((row, index) => {
        return (
            <tr key = {row}>
                <td>{row}</td>
                <td>{getFreq(row, props.config)}</td>
                <td>{props.logs[row]}</td>
            </tr>
        )

    });
    return (
        <tbody>
          {rows}
         </tbody>
     );
}

function Table(props) {
    return (
        <table>
            <TableHeader />
            <TableBody logs = {props.logs} config = {props.config}/>
        </table>
    );
}

export default Table;
